from pybricks.hubs import PrimeHub
from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

# Set up all devices.
prime_hub = PrimeHub()
right_motor = Motor(Port.A, Direction.COUNTERCLOCKWISE)
left_motor = Motor(Port.B, Direction.CLOCKWISE)
front_motor = Motor(Port.E, Direction.CLOCKWISE)
top_motor = Motor(Port.F, Direction.COUNTERCLOCKWISE)
drive_base = DriveBase(left_motor, right_motor, 80, 114)

async def main():
    print('Hello, Pybricks!')
    drive_base.settings(straight_speed=400)
    await multitask(drive_base.straight(-745), front_motor.run_angle(200, 65))
    await front_motor.run_angle(500, 65, Stop.COAST)
    await front_motor.run_angle(500, -65)
    await drive_base.straight(-40)
    await front_motor.run_angle(500, 65)
    await front_motor.run_angle(500, -65)
    await drive_base.turn(20)
    await drive_base.straight(65)
    await front_motor.run_angle(500, -120)
    await drive_base.straight(40)
    await front_motor.run_angle(2000, 69)


run_task(main())